import React from 'react';

const VisionPage = () => {
  return (
    <div className="container mx-auto text-center p-8">
      <h1 className="text-3xl font-bold mb-4">🌟 חזון אישי ויעדים 🌟</h1>
      <p>כאן תוכלו לנסח חזון אישי, להגדיר יעדים ולעקוב אחר ההתקדמות שלכם.</p>
      <div className="mt-6">
        <button
          onClick={() => window.history.back()}
          className="bg-blue-500 text-white px-4 py-2 rounded-md"
        >
          חזור אחורה
        </button>
      </div>
    </div>
  );
};

export default VisionPage;
